import { createSlice, createAsyncThunk } from "@reduxjs/toolkit";
import axios from "axios";

const apiUrl = "http://localhost:8000/";

export const fetchAsyncCompany_listGet = createAsyncThunk("company_list/get", async (token) => {
    const res = await axios.get(`${apiUrl}api/pdf/`, {
      headers: {
        Authorization: `JWT ${token}`,
      },
    });
    return res.data;
});


const pdfSlice = createSlice({
    name: 'pdf_info',
    initialState: {
        company_list: [
            {
                id: '',
                company: 0,
                pdf_type: 0,
                pdf_title: '',
                pdf: '',
                regist_date: '',
            },
        ]
    },
    reducers: {

    },
    extraReducers: (builder) => {
        builder.addCase(fetchAsyncCompany_listGet.fulfilled, (state, action) => {
          state.company_list = action.payload;
        });
    },
})

export const {} = pdfSlice.actions;
export const selectCompany_list = (state) => state.pdf.company_list;

export default pdfSlice.reducer;
